import {anLogin, LOGIN_TRUE} from "../constants/isLoginConstants";
import {LOGIN_FALSE} from "../constants/isLoginConstants";

export const loginTrue = (login) => {
    return {
        type: LOGIN_TRUE,
        login: login
    }
};

export const loginFalse = () => {
  return {
      type: LOGIN_FALSE
  }
};
